import React from 'react'
import { Formik, Form, Field, ErrorMessage } from "formik";
import axios from "axios";
function Login() {
  const userData = {
    username: "",
    password: "",
  };
  const submit = (data)=>{
    axios.post("http://localhost:3004/auth/login",data).then((response)=>{
      console.log(response.data);
    })
  }
  return (
    <div>
       <Formik
        initialValues={userData}
        onSubmit={submit}
      >
        <Form className="form">
          <label>Username:</label>
          <Field id="inputTitle" name="username" placeholder="(Eg. username...)" autocomplete="off"/>
          <label>Password:</label>
          <Field
            type="password"
            id="inputUsername"
            name="password"
            placeholder="Your password..."
            autocomplete="off"
          />
          <button type="submit">Login</button>
        </Form>
      </Formik>
    </div>
  )
}

export default Login
